import React from "react"

export default function MapLegend({categories, colors, activeCategories, onClick, display, ...restProps}) {
  return (
    <div className="map-legend unselectable">
      <span style={{ fontWeight: 'bold', color: '#51cbce' }}>Legenda</span>
      <ul>
        {
          categories.map((category, index) => {
            return (
              <li key={`point-${index}`}
                onClick={onClick(index)}
                style={{ textDecoration: activeCategories[index] && 'line-through', color: activeCategories[index] && 'grey' }}
              >
                <div className="point-color" style={{ backgroundColor: activeCategories[index] ? 'grey' : colors[category] }} />
                {display[category]}
              </li>
            )
          })
        }
      </ul>
    </div>
  )
}
